import React from 'react';
import './App.css';
import Home from './Home';
import Pred from './PricePredictions';
import GenPred from './GeneratedPredictions';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/PricePredictions" element={<Pred />} />
        <Route path="/GeneratedPredictions" element={<GenPred />} />
      </Routes>
    </div>
  );
}

export default App;
